import { Link } from "react-router-dom";
import './bouton.css';

export default function Accueil() {
  return (
    <div style={{ textAlign: "center", marginTop: "50px" }}>
      <h1>Bienvenue sur le système de Fiche de Paie</h1>
      <p>Choisissez une action :</p>
      <div style={{ marginTop: "20px" }}>
        <Link to="/fiche">
          <button style={{
            padding: "10px 20px",
            fontSize: "16px",
            borderRadius: "8px",
            cursor: "pointer"
          }}>
            Générer une fiche de paie
          </button>
          <div className="btn-group">
            <Link to="/fiche" className="btn primary" data-text="Créer une fiche">Créer une fiche</Link>
            <Link to="/Dashboard" className="btn secondary" data-text="Voir toutes les fiches">Voir toutes les fiches</Link>
          </div>
        </Link>
      </div>
    
    </div>

  
  );
}
